This Square is privately owned by the{Westminster Estate.}It consists of two major land uses, which are{ {Enclosed rough grazing},Which is the major land use for the entire block, and{Deciduous woodland. There are two buldings in this square, one of which is a farmhouse and the other a house for someone who works on the Estate.
{ Attitudes { }All this square is privately owned by the estate, and only estate workers live here. They are content with their quiet lives and would not welcome any rapid change, although some understand that it is innevitable.
